# -*- coding: utf-8 -*-from math import ceilrounds = int(input())result = list()a = -1b = 0for i in range(rounds):    text = input().split()    for j in range(len(text)):        result.append(max([int(text[a]), int(text[b])]))        if max([int(text[a]), int(text[b])]) == int(text[a]):            a -= 1        elif max([int(text[a]), int(text[b])]) == int(text[b]):            b += 1    k = result.copy()    k.sort(reverse=True)    if result == k:        for i in result:            print(i, end=' ')        print()    else:        print('НЕТ')    result = list()    a = -1    b = 0